async function getHamsterReport(begin, end, ignore) {
    if ((await Deno.permissions.query({
        name: "run"
    })).state !== "granted") {
        throw new Error(`Missing Deno run permission"`);
    }
    const hamsterReport = await Deno.run({
        cmd: [
            "hamster",
            "export",
            "tsv",
            begin,
            end
        ],
        stdout: "piped"
    }).output();
    return new TextDecoder().decode(hamsterReport).split("\n").slice(1).filter((line)=>line).map((line)=>{
        const [comment, date, , minutes, category] = line.split("\t");
        return {
            comment: `${comment}@${category}`,
            date,
            minutes
        };
    }).filter(({ comment , date , minutes  })=>!ignore || !comment || !comment.match(ignore)).map(({ comment , date , minutes  })=>{
        return {
            comment,
            date: date?.substr(0, 10),
            hours: Math.round(100 * parseFloat(minutes) / 60) / 100
        };
    });
}
